So a few weeks ago, I teamed up with @arnoldbyun and @stuffbeneats to create collaborative @withwarmwelcome episodes called Friends & Family. ⁣
⁣
We checked in with some of the previous guests from the podcast. One of them was Chef Jimmy Ly of the Vietnamese restaurant Madame Vo. ⁣I first met Jimmy at the Prix Fixe for Youth event that Arnold and Jimmy hosted as a fundraiser for @apexforyouth. Since then, whenever I’ve visited his restaurants, be it with friends and coworkers alike, we always had a great time.
⁣
Currently, Madame Vo is doing both delivery and outdoor dining.  If you’re craving Vietnamese food, order from them. You’ll be getting good food and will be supporting one of the small businesses that makes East Village a special place. 🙂⁣
⁣
Fun #bts fact: Ben insisted that we get the Madame Pho with the short rib supplement. As it came out, the couple sitting at the table next to us (who did not get the short rib) looked so longingly at our bowl. Ben, of course, noticed this and told them that they too could get one for an extra six dollars, and proceeded to ask if they wanted it. They said yes, so Ben took that order and relayed it to the staff working there that day.  The moral of the story? That @stuffbeneats makes everything look delicious and trust him on his food recs 😛⁣
⁣
